import React from "react";
import { AppBar, Toolbar, Typography, IconButton, Box, Button } from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import CakeIcon from "@mui/icons-material/Cake";
import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <AppBar
      position="sticky"
      elevation={0}
      sx={{
        background: "#ffebf0", // soft pink
        paddingY: 1,
        borderBottom: "2px solid #ffd1dc", 
      }}
    >
      <Toolbar sx={{ display: "flex", justifyContent: "space-between" }}>
        
        {/* Left: Logo */}
        <Box display="flex" alignItems="center">
          <CakeIcon sx={{ color: "#ff4f7b", fontSize: 32, marginRight: 1 }} />
          <Typography
            variant="h5"
            sx={{ color: "#ff4f7b", fontWeight: "bold", fontFamily: "cursive" }}
            component={Link}
            to="/"
            style={{ textDecoration: "none" }}
          >
            SweetCraft
          </Typography>
        </Box>

        {/* Middle: Category Buttons */}
        <Box>
          <Button
            component={Link}
            to="/category/bento-cakes"
            sx={{
              mx: 1,
              color: "#d6336c",
              background: "#ffe6ea",
              borderRadius: 3,
              "&:hover": { background: "#ffd6df" },
            }}
          >
            Cakes
          </Button>

          <Button
            component={Link}
            to="/category/pastries"
            sx={{
              mx: 1,
              color: "#d6336c",
              background: "#ffe6ea",
              borderRadius: 3,
              "&:hover": { background: "#ffd6df" },
            }}
          >
            Pastries
          </Button>

          <Button
            component={Link}
            to="/category/waffles"
            sx={{
              mx: 1,
              color: "#d6336c",
              background: "#ffe6ea",
              borderRadius: 3,
              "&:hover": { background: "#ffd6df" },
            }}
          >
            Waffles
          </Button>

          <Button
            component={Link}
            to="/category/pancakes"
            sx={{
              mx: 1,
              color: "#d6336c",
              background: "#ffe6ea",
              borderRadius: 3,
              "&:hover": { background: "#ffd6df" },
            }}
          >
            Pancakes
          </Button>
        </Box>

        {/* Right: Cart */}
        <IconButton
          component={Link}
          to="/cart"
          sx={{ color: "#ff4f7b" }}
        >
          <ShoppingCartIcon sx={{ fontSize: 30 }} />
        </IconButton>

      </Toolbar>
    </AppBar>
  );
}
